import ReactDOM from "react-dom";

import "./index.css";
import App from "./App";
import Admin from "./components/admin/Admin";

ReactDOM.render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<App />}>
        {/* <Route index element={<Home />} /> */}
        <Route path="admin" element={<Admin />}/>
      </Route>
    </Routes>
  </BrowserRouter>,
  document.getElementById("root")
);
